import { useState } from "react";

import styled from "styled-components";
//import { Button } from 'antd'

const Background = styled.div`
    background: black;
    opacity: 70%;
    position: absolute;
    top: 0;
    bottom: 0;
    left: 0;
    right: 0;
`

const Title = styled.div`
    color: white;
    font-size: 200px
`

const Cover = () => {
    const [display, setDisplay] = useState(1)
    const handleClick = () => {
        setDisplay(0)
    }
    return(
        display &&
        <Background>
            <Title>Welcome.</Title>
            <button onCLick={handleClick}>Come in!</button>
        </Background>
    )
}

export default Cover;
